import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import PrivateRoute from './PrivateRoute';
import AuthService from './authService';
import RegistrationForm from './components/register/RegistrationForm';
import LoginForm from './components/login/LoginForm';
import ElectionsReg from './components/electionRegistry/electionRegForm';
import ElectionsList from './components/electionList/electionList';
import CreateElection from './components/electionCreate/electionCreate';
import CandidateForm from './components/candidateList/candidateForm';
import CandidateAdd from './components/candidateAdd/candidateAdd';

const Home = () => <h2>Home</h2>;
const Dashboard = () => <h2>Dashboard</h2>;
const Logout = () => (
  <div>
    <h2>Logout</h2>
    <button onClick={AuthService.logout}>Logout</button>
  </div>
);

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<LoginForm />} />
          <Route path="/login" element={<LoginForm />} />
          <Route path="/register" element={<RegistrationForm />} />

          {/* Private Routes */}
          <Route
            path="/logout"
            element={
              <PrivateRoute>
                <Logout />
              </PrivateRoute>
            }
          />
          <Route
            path="/electionreg"
            element={
              <PrivateRoute>
                <ElectionsReg />
              </PrivateRoute>
            }
          />
          <Route
            path="/electionsform"
            element={
              <PrivateRoute>
                <ElectionsList />
              </PrivateRoute>
            }
          />
          <Route
            path="/create"
            element={
              <PrivateRoute>
                <CreateElection />
              </PrivateRoute>
            }
          />
          <Route
            path="/candform"
            element={
              <PrivateRoute>
                <CandidateForm />
              </PrivateRoute>
            }
          />
          <Route
            path="/candadd"
            element={
              <PrivateRoute>
                <CandidateAdd />
              </PrivateRoute>
            }
          />

          {/* Default Redirect */}
          <Route path="*" element={<Navigate to="/login" replace={true} />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
